import{_ as e,o as t,c as i,a}from"./app.794d0f36.js";var r="/aktivitaeten/BDM-2025-08/00_08-2025.jpg",n="/aktivitaeten/BDM-2025-08/01_08-2025.jpg",s="/aktivitaeten/BDM-2025-08/02_08-2025.jpg",d="/aktivitaeten/BDM-2025-08/03_08-2025.jpg",l="/aktivitaeten/BDM-2025-08/04_08-2025.jpg",m="/aktivitaeten/BDM-2025-08/05_08-2025.jpg",g="/aktivitaeten/BDM-2025-08/06_08-2025.jpg",o="/aktivitaeten/BDM-2025-08/07_08-2025.jpg",p="/aktivitaeten/BDM-2025-08/08_08-2025.jpg",_="/aktivitaeten/BDM-2025-08/09_08-2025.jpg",u="/aktivitaeten/BDM-2025-08/10_08-2025.jpg",v="/aktivitaeten/BDM-2025-08/11_08-2025.jpg",c="/aktivitaeten/BDM-2025-08/12_08-2025.jpg",B="/aktivitaeten/BDM-2025-08/13_08-2025.jpg",M="/aktivitaeten/BDM-2025-08/14_08-2025.jpg",h="/aktivitaeten/BDM-2025-08/15_08-2025.jpg",k="/aktivitaeten/BDM-2025-08/16_08-2025.jpg",D="/aktivitaeten/BDM-2025-08/17_08-2025.jpg",b="/aktivitaeten/BDM-2025-08/18_08-2025.jpg",f="/aktivitaeten/BDM-2025-08/19_08-2025.jpg",j="/aktivitaeten/BDM-2025-08/20_08-2025.jpg",S="/aktivitaeten/BDM-2025-08/21_08-2025.jpg",A="/aktivitaeten/BDM-2025-08/22_08-2025.jpg",T="/aktivitaeten/BDM-2025-08/23_08-2025.jpg",w="/aktivitaeten/BDM-2025-08/24_08-2025.jpg",F="/aktivitaeten/BDM-2025-08/25_08-2025.jpg",W="/aktivitaeten/BDM-2025-08/26_08-2025.jpg",z="/aktivitaeten/BDM-2025-08/27_08-2025.jpg",E="/aktivitaeten/BDM-2025-08/28_08-2025.jpg",P="/aktivitaeten/BDM-2025-08/29_08-2025.jpg",K="/aktivitaeten/BDM-2025-08/30_08-2025.jpg",O="/aktivitaeten/BDM-2025-08/31_08-2025.jpg",N="/aktivitaeten/BDM-2025-08/32_08-2025.jpg",H="/aktivitaeten/BDM-2025-08/33_08-2025.jpg",C="/aktivitaeten/BDM-2025-08/34_08-2025.jpg",G="/aktivitaeten/BDM-2025-08/35_08-2025.jpg",R="/aktivitaeten/BDM-2025-08/36_08-2025.jpg",L="/aktivitaeten/BDM-2025-08/37_08-2025.jpg",Q="/aktivitaeten/BDM-2025-08/38_08-2025.jpg",V="/aktivitaeten/BDM-2025-08/39_08-2025.jpg",x="/aktivitaeten/BDM-2025-08/40_08-2025.jpg",J="/aktivitaeten/BDM-2025-08/41_08-2025.jpg",U="/aktivitaeten/BDM-2025-08/42_08-2025.jpg",X="/aktivitaeten/BDM-2025-08/43_08-2025.jpg",I="/aktivitaeten/BDM-2025-08/44_08-2025.jpg",Y="/aktivitaeten/BDM-2025-08/45_08-2025.jpg",Z="/aktivitaeten/BDM-2025-08/46_08-2025.jpg",y="/aktivitaeten/BDM-2025-08/47_08-2025.jpg",q="/aktivitaeten/BDM-2025-08/48_08-2025.jpg",$="/aktivitaeten/BDM-2025-08/49_08-2025.jpg",ee="/aktivitaeten/BDM-2025-08/50_08-2025.jpg",te="/aktivitaeten/BDM-2025-08/51_08-2025.jpg",ie="/aktivitaeten/BDM-2025-08/52_08-2025.jpg",ae="/aktivitaeten/BDM-2025-08/53_08-2025.jpg",re="/aktivitaeten/BDM-2025-08/54_08-2025.jpg",ne="/aktivitaeten/BDM-2025-08/55_08-2025.jpg",se="/aktivitaeten/BDM-2025-08/56_08-2025.jpg";const de={},le=a('<h1 id="bilder-des-monats-august-2025" tabindex="-1"><a class="header-anchor" href="#bilder-des-monats-august-2025" aria-hidden="true">#</a> Bilder des Monats August 2025</h1><p>Heute gab es ein spontanes Draussenfunkertreffen auf dem Berliner Tempelhofer Feld (DE-0169) anl\xE4sslich der bestandenen Klasse A Pr\xFCfung von DA2SSB, Steve. W\xE4hrend DL9PK, Phillip und DA2SSB, Steve den Park aktivierten, baute Basti eine 10m Moxon auf. Leider gelang mit diesem Versuchsaufbau heute kein QSO.</p><p><img src="'+r+'" alt="Bilder des Monats"><img src="'+n+'" alt="Bilder des Monats"><img src="'+s+'" alt="Bilder des Monats"></p><p>Am 06.08.2025 habe ich meine neue selbstgebauten 40 Meter lange EFHW f\xFCr die B\xE4nder 80, 40, 20, 15 und 10 Meter in meinem POTA-Hauspark DE-0546 Hachinger Tal das erste Mal aufgebaut, eingemessen und ausprobiert. Dabei kamen dann meine ersten beiden 80-Meter-Band-QSOs in SSB ins Aktivierungslog. Herausfordernd war der erste initiale Aufbau, da die 40-Meter-Antenne doch eine eigene Hausnummer ist und mein Stammplatz im Park an seine aufbautechnischen Grenzen gekommen ist.</p><p>Equipment:</p><ul><li>TRX FT-891</li><li>Tuner MAT-30</li><li>Akku 12V/12Ah</li><li>EFHW 1:64 UnUn mit 42 Meter DX-Wire UL und 4 Meter Gegengewicht</li><li>15 Meter RG58 mit Mantelwellensperre zwei Meter vom Antennenspeisepunkt entfernt.</li></ul><p>vy 73 de Alex DB7GKA</p><p><img src="'+d+'" alt="Bilder des Monats"><img src="'+l+'" alt="Bilder des Monats"><img src="'+m+'" alt="Bilder des Monats"><img src="'+g+'" alt="Bilder des Monats"><img src="'+o+'" alt="Bilder des Monats"><img src="'+p+'" alt="Bilder des Monats"></p><p>Am 07.08.2025 war es soweit \u2013 mein (DA6TW) erster Ausflug ins Satellitenfunk-Abenteuer \u{1F680}\u{1F4E1} Aktiviert habe ich dabei gleich zwei POTA-Parks: \u{1F333} DE-0192 \u2013 Saar Regional Park \u{1F333} DE-0693 \u2013 Biosph\xE4re Bliesgau Biosphere Reserve (zugleich auch WWFF-Park DLFF-0033) John (DK9JC) hat mich geduldig in die Kunst des Satellitenfunks eingef\xFChrt und wirklich jede meiner Fragen \u2013 und sei sie noch so klein gewesen \u2013 tapfer beantwortet. Fazit: Ein super spannender und lehrreicher Tag! \u{1F4A1} Es wird sicher nicht das letzte Mal sein, dass man mich \xFCber einen Satelliten h\xF6rt. Gearbeitet habe ich: SAT AO-7 und SAT RS-44 auf 2 m / 70 cm SSB (mit Johns Ausr\xFCstung) 3 Test-QSOs auf FT8 im 15 m-Band mit meinem neuen Yaesu FT-818ND Mit dem FT-818ND und meinem vorhandenen Yaesu FT-991A steht das Grundger\xFCst f\xFCr meine k\xFCnftige Satellitenkarriere schon mal bereit. \u{1F604} Danke, John (DK9JC), f\xFCr diese tolle Erfahrung \u2013 bis zum n\xE4chsten Mal!</p><p><img src="'+_+'" alt="Bilder des Monats"><img src="'+u+'" alt="Bilder des Monats"><img src="'+v+'" alt="Bilder des Monats"><img src="'+c+'" alt="Bilder des Monats"></p><p>Im Urlaub hab ich heut zum ersten Mal meine CEPT-Lizenz genutzt und durfte als OZ/DK4MJ den Vadehavet National Park DK-0101 sowie OZFF-0004 aktivieren. Es war viel los auf 20m und so gelangen mir 47 QSOs und somit auch die Aktivierung beim WWFF Programm. Beim Rufen bin ich manchmal ist Stottern gekommen wegen dem L\xE4nder-Prefix... Es war ein sehr sch\xF6ner Nachmittag im Naturpark.</p><p><img src="'+B+'" alt="Bilder des Monats"><img src="'+M+'" alt="Bilder des Monats"><img src="'+h+'" alt="Bilder des Monats"></p><p>Meine heutige Aktivierung von DK-0101 und OZFF-004 habe ich am Strand gemacht. W\xE4hrend meine Mitreisenden in den Wellen planschten, hab ich Funkwellen ausgesendet. Vor mir die rauschende Nordsee und im Kopfh\xF6rer das Rauschen des 20m Bandes\u2026</p><p><img src="'+k+'" alt="Bilder des Monats"><img src="'+D+'" alt="Bilder des Monats"><img src="'+b+'" alt="Bilder des Monats"></p><p>Als SV/DF9HC zwei Parks auf Korfu aktiviert. Mit 5 W gelangen einmal 21 QSOs in SSB und CW aus GR-0121 und 16 QSOs in SSB aus GR-0122. Antenne war die DF Vertical am FT-817.</p><p><img src="'+f+'" alt="Bilder des Monats"><img src="'+j+'" alt="Bilder des Monats"><img src="'+S+'" alt="Bilder des Monats"><img src="'+A+'" alt="Bilder des Monats"><img src="'+T+'" alt="Bilder des Monats"><img src="'+w+'" alt="Bilder des Monats"></p><p>Thyrowberg (Ketzin) mit DN9CU, Technik testen, Tag genie\xDFen und Contest auf 20/40m zuh\xF6ren. 10/15m ging erst gegen Nachmittag etwas.</p><p><img src="'+F+'" alt="Bilder des Monats"><img src="'+W+'" alt="Bilder des Monats"><img src="'+z+'" alt="Bilder des Monats"><img src="'+E+'" alt="Bilder des Monats"></p><p>Heute hatte ich meine erste Aktivierung als W0/DC1TC in Missouri von US-1769 Weston Bend State Park. Es war etwas z\xE4h, aber in ca. 1h 40m kamen 8 SSB und 4 CW-Kontakte zustande.</p><p><img src="'+P+'" alt="Bilder des Monats"><img src="'+K+'" alt="Bilder des Monats"><img src="'+O+'" alt="Bilder des Monats"></p><p>Am 20.08.2025 hat Markus DG6KP den Nationalpark Nieders\xE4chsiches Wattenmeer DE-0094 in Neuharlingersiel aktiviert. Dabei kam ein Linked Dipol f\xFCr 20-30-40m zum Einsatz. Da es im Wattenmeer keine Schilder oder Pf\xE4hle gibt, musste der Mastfu\xDF mit dem Fahrrad und ein paar gro\xDFen Steinen improvisiert werden. Das hat erstaunlicher Weise die gesamte Aktivierung \xFCber gehalten, trotz starkem Wind. Mit dem (tr)usdx und einem alten Android-Tablet kamen 49 Verbindungen in FT8 ins Log, davon 9 auf 30m, der Rest auf 20 und vor allem 40m.</p><p><img src="'+N+'" alt="Bilder des Monats"><img src="'+H+'" alt="Bilder des Monats"><img src="'+C+'" alt="Bilder des Monats"><img src="'+G+'" alt="Bilder des Monats"><img src="'+R+'" alt="Bilder des Monats"><img src="'+L+'" alt="Bilder des Monats"><img src="'+Q+'" alt="Bilder des Monats"></p><p>After work late shift Aktivierung vom Jacobipark in Hamburg DE-0260 durch Harm, DK4HAA am 26.08.2025. 30 SSB-QSOs auf 20 und 40 m in etwas \xFCber einer Stunde.</p><p><img src="'+V+'" alt="Bilder des Monats"><img src="'+x+'" alt="Bilder des Monats"><img src="'+J+'" alt="Bilder des Monats"><img src="'+U+'" alt="Bilder des Monats"><img src="'+X+'" alt="Bilder des Monats"></p><p>Am 27.08.2025 habe ich den Familienbesuch bei den Schwiegereltern genutzt, um den bisher noch nicht aktivierten Park DE-1037 Beuche - Wethautal Natura 2000 bei Eisenberg in Th\xFCringen in die Luft zu bringen. Die Erstaktivierung ist mir am Vormittag mit insgesamt 27 QSOs in SSB auf 20 und 40 Meter gegl\xFCckt. Beim letzten QSO musste ich die Aktivierung leider abbrechen, da ein st\xF6rendes Tr\xE4gersignal mit S9+10db jegliche Kommunikation verunm\xF6glicht hat. Alles in allem war es trotzdem eine sch\xF6ne Aktivierung bei herrlichem sp\xE4tsommerlichen Wetter.</p><p>73 Alex DB7GKA</p><p><img src="'+I+'" alt="Bilder des Monats"><img src="'+Y+'" alt="Bilder des Monats"><img src="'+Z+'" alt="Bilder des Monats"><img src="'+y+'" alt="Bilder des Monats"></p><p>Die Aktivierung des Trail Th\xFCringenweg DE-0945 durch DB7GKA war bei angenehmen 21 Grad Celsius mit 26 QSOs in SSB auf 40 Meter erfolgreich. Der s\xFCdlich von Eisenberg im M\xFChltal gelegene Aktivierungsspot bei JO50XW08lm hat trotz Tallage gute Rapporte gebracht. Als Antenne fungierte eine EFHW f\xFCr die B\xE4nder 40/20/15/10 aufgebaut als Inverted-V an der ein TRX Yaesu FT-891 mit 34 Watt Sendeleistung angeschlossen war.</p><p><img src="'+q+'" alt="Bilder des Monats"><img src="'+$+'" alt="Bilder des Monats"><img src="'+ee+'" alt="Bilder des Monats"></p><p>In Kansas habe ich als W0/DC1TC noch erfolgreich das Tallgrass Prairie National Preserve US-3673 aktiviert. Nach kleinen tierischen Besuchern w\xE4hrend der Aktivierung gab es danach auf der Tour durch das Preserve noch gro\xDFe Tiere, aber nur aus sicherer Entfernung.</p><p><img src="'+te+'" alt="Bilder des Monats"><img src="'+ie+'" alt="Bilder des Monats"><img src="'+ae+'" alt="Bilder des Monats"><img src="'+re+'" alt="Bilder des Monats"><img src="'+ne+'" alt="Bilder des Monats"></p><p>DB6NL: Heute hab ich mal den Westfalen Wander Weg (DE-0959) aktiviert. Der ist von zuhause schnell zu Fuss erreichbar und direkt am Weg gibt es eine sch\xF6nen offenen Gem\xFCsegarten, der von vielen Familien bewirtschaftet wird. Ein toller und entspannter Spot\u2026</p><p><img src="'+se+'" alt="Bilder des Monats"></p>',33),me=[le];function ge(oe,pe){return t(),i("div",null,me)}var ue=e(de,[["render",ge],["__file","2025-08-30-Bilder-Des-Monats-August.html.vue"]]);export{ue as default};
